	add("farthingale", "{\"term\":\"farthingale\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027verdugale\u0027 from Spanish \u0027verdugado\u0027 from \u0027verdugo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hooped structure in cloth worn to extend the skirt of women\u0027s dresses; a hooped petticoat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"womenmake trunk-sleeves of wyre and whale-bone bodies, backes of lathes, and stiffe bumbasted \u0027\u0027verdugals\u0027\u0027, and to the open-view of all men paint and embellish themselves with counterfeit and borrowed beauties\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027The Guardian\u0027, 3 May 2003\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In Henry VIII\u0027s Great Hall, there were men in doublets and codpieces prancing up and down with women in \u0027\u0027farthingales\", \"priority\":5}]}, \"synonyms\":{}}");

